  \"A new method for capturing alligators using electricity\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:08.531591\",\n\t\"name\": \"a-new-method-for-capturing-alligators-using-electricity\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A study was initiated on Rockefeller Wildlife
  Refuge in order to investigate the possibility of using an electrical current as
  an aid in capturing alligators. A modified 110-220 volts-A.C. fish shocking unit
  and a 110-220 volts-D.C. pulsating unit were used in this study. Best results were
  obtained with the 110-220 volts-D.C. pulsating unit. This method is limited to areas
  of low water salinity and best results were obtained when the animal was partially
  exposed and the unit could be applied directly. Mortality occurred where alligators
  were repeatedly shocked and also if the prod was applied to the under surface of
  the stomach. The best results were obtained by applying the shock to the side of
  the neck just anterior to the front legs. Alligators were completely immobilized
  for approximately 15-25 minutes. Field test were limited as the unit was found u00b7to
  b~ greatly affected by salinity.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
